import React from "react";
import { CssBaseline } from "@material-ui/core";
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import { makeStyles } from '@material-ui/core/styles';
import wallpaper from "../components/images/wallpaper.jpeg";
import { classes } from "istanbul-lib-coverage";
// import './Home.css';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  button: {
    backgroundColor: '#000',
    color: '#fff',
    '&:hover': {
      backgroundColor: '#fff',
      color: '#3c52b2',
    }
  },
  title: {
    flexGrow: 1,
    display: 'flex',
    color: 'white',
    fontFamily: 'Nunito',
  },

}));

const Home = () => {
  const classes = useStyles();

  return (
    <React.Fragment>
      <CssBaseline />
      <div className={classes.root}>
        <img src={wallpaper} alt="Wallpaper" className="homeImage" />
        <Container maxWidth="md" className="homeText">
          <Typography className="homeTextName">Hey There.</Typography>
          <Typography className="homeTextTitle">Wanna Join the "fur-ty?</Typography>
        </Container>
      </div>
    </React.Fragment>
  );
}

export default Home;
